INSERT INTO `blog_post` VALUES ('New Blog & Help Page','<p>Hey all! It\'s Solo Espero here, creator of this website. I\'ve created this blog to give update notes about what I\'ve added.</p>\r\n<p>With this update, I\'ve added a new Help page, which can be found from the home page. The Help page gives some helpful advice as to how to use Clash&nbsp;Tracker if its your first time using it. That and this new blog are the main components about this update. There were also various minor changes I added, such as fixing timing issues, styling issues on the player page, etc. that I\'m sure you wouldn\'t want me to bore you with.</p>\r\n<p>Until next time, Clash on!</p>','2016-04-08 20:55:46'),('Customizable War Scores','<p>Hey all, Solo Espero here again!</p>\r\n<p>I just added the ability to customize player scoring on the War Statistics page. This allows you to put higher priority on what you think is important in the war! Do you think attacking is more important or defence? Are first attacks a priority in your clan? Do you care about total stars of attacks or just how many count towards the war?</p>\r\n<p>This update also adds in the average rank compared to the players when attacking and defending and is now part of calculating the score for players and with the other part the update, is able to customize how much it affects the scoring!</p>\r\n<p>Clash on!</p>','2016-05-07 17:52:35'),('COMING SOON','<p>With the May 2016 Clash of Clans update, there have been a couple new additions to their API. We will be able to directly save players from the API without the need for you to input their player tags anymore! Hurray!</p>\r\n<p>There are a few other changes, including a bit of details from wars, that we will experiment with and hopefully add some of the new information into the site</p>\r\n<p>We cannot guarantee a specific time of the update, but hopefully it will be within the next week or so!</p>','2016-05-25 12:58:35');
